import React from 'react'
import Navbar from './navbar';

const Home = () => {
  return(
    <>
        <div className="" style={{height:'100vh'}}> 
          <Navbar/>
          <div className='container d-flex justify-content-center mt-5'  >
                <h2 style={{borderBottom:"2px solid"}}>Features</h2>
          </div>
          

           
          

        </div>
    </>

  )
   
}

export default Home;
